import { Card, Jumbotron, Containter, Row, Col } from "react-bootstrap";

export default function About() {
  return (
    <div>
      <Jumbotron fluid>
        <Container>
          <h1>Fluid jumbotron</h1>
          <p>
            This is a modified jumbotron that occupies the entire horizontal
            space of its parent.
          </p>
        </Container>
      </Jumbotron>

      <h2>Team</h2>
      {/*Cards with brief and link to LinkedIn*/}
      <div>Ian</div>
      <div>Khalil</div>
      <div>Ryan</div>
      {/*For Members */}
      {/*For Community*/}
      {/*For Sponsors*/}
    </div>
  );
}
